var nodes = {}; 
 
 links.forEach(function(link) {
  link.source = nodes[link.source] || (nodes[link.source] = {name: link.source, group:2});
  link.target = nodes[link.target] || (nodes[link.target] = {name: link.target, group:2});
});

var width = 1920,
    height = 1080;
var color = d3.scale.category20();
var force = d3.layout.force()
    .nodes(d3.values(nodes))
    .links(links)
    .size([width, height])
    .linkDistance(1)
    .charge(-100)
    .on("tick", tick)
    .start();

var svg = d3.select("body").append("svg")
    .attr("width", width)
    .attr("height", height);

var link = svg.selectAll(".link")
    .data(force.links())
  .enter().append("line")
    .attr("class", "link")
    .style("stroke-width", function(d) { return Math.sqrt(0.01*d.value); });

var node = svg.selectAll(".node")
    .data(force.nodes())
  .enter().append("g")
    .attr("class", "node")
    .call(force.drag);

node.append("circle")
    .attr("r",5)
    .style("fill", function(d) { return color(d.group); });

//node.append("text")
    // .attr("x", 12)
    // .attr("dy", ".35em")
    // .text(function(d) { return d.name; });

function tick() {
  link
      .attr("x1", function(d) { return d.source.x; })
      .attr("y1", function(d) { return d.source.y; })
      .attr("x2", function(d) { return d.target.x; })
      .attr("y2", function(d) { return d.target.y; });

  node
      .attr("transform", function(d) { return "translate(" + d.x + "," + d.y + ")"; });
}
